import React from 'react'
import { useState } from 'react'
import { FaRegTrashCan } from "react-icons/fa6";
const Face = () => {
  const [items,setItems]=useState(
    [
      {
        id:1,
        checked:true,
        name:"Reserve the Bus Ticket"
      },
      {
        id:1,
        checked:true,
        name:"Reserve the Bus Ticket"
      },
      {
        id:1,
        checked:true,
        name:"Reserve the Bus Ticket"
      },
      {
        id:1,
        checked:true,
        name:""
      }
    ]
  )
  return (
    <div>
      <p>To DO List</p>
      <ul>
        {
          items.map((item)=>(
            <li>
              <input
              type="checkbox"
              checked={item.checked}/>
              <label>{item.name}</label>
              <FaRegTrashCan 
              role="button"
              tabIndex={0}
              />
            </li>
          ))
        }
      </ul>
    </div>
  )
}

export default Face
